import React from 'react';
import './Footer.css';

const Footer = () => {
	return (
		<div className='main-footer'>
			<div className='container'>
				<div className='row'>
					<div className='col'>	
						<p><i class="fas fa-beer"></i> Bookaneer</p>				
					</div>	
					<div className='col'>
						<p><i class="far fa-copyright"></i> 2020 All right reserved</p>
					</div>
					<div className='col'>
						<p>Crafted with <i class="fas fa-heart"></i> e <i class="fas fa-mug-hot"></i> for Real Bookaneer</p>
						</div>		
						
			</div>
		</div>
		</div>
	)
}
export default Footer;
